import Input from "../../UI/Input";
import classes from "./CSS/MealItemForm.module.css";

const MealItemForm = () => {
  const console =() => {console.log(props.input.id)};
  return (
    <form className={classes.form}>
      <Input
        label="Amount"
        input={{
          id: "amount",
          type: "number",
          min: "1",
          max: "5",
          step: "1",
          defaultValue: "1",
          onChange: console()
        }}
      />
      <button>+ Add</button>
    </form>
  );
};

export default MealItemForm;
